import axios from 'axios';
export default class ScheduleService{
    deleteTimetable(id) {
        axios.delete('http://localhost:8070/timetables/deleteTimetable' + id)
        .then(response => {
            return response.data
         })
         .then(data => {
            console.log(data)
         })
         

 }}
